INSERT INTO `notes` VALUES (5,'B','ASP.NET Literal vs Label','&lt;hr&gt;&lt;p&gt;基於開發需求，需要尋找一個可以顯示文字的控件，但Label內置的一些特點不符合我的開發需求，對於樣式的撰寫層級或是對純文字的展現就適合依靠Literal來解決問題。以下列出兩個控件的特點：&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Label可以設定樣式，Literal不行，他不包含任何HTML tag，因此也沒有CssClass屬性。&lt;/li&gt;&lt;li&gt;Label可以直接渲染HTML內容，Literal需要加上屬性&lt;code&gt;Mode=&quot;PassThrough&quot;&lt;/code&gt;。&lt;/li&gt;&lt;li&gt;在Label中的文字會在內呈現，Literal為完全純文字，因此Label適用於JavaScript或JQuery的使用情境。&lt;/li&gt;&lt;li&gt;以效能跟大小來說，Literal更為輕量，因為他不進行任何解析與樣式處理。如果顯示純文字或是原始HTML，那Literal的選擇更好。&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;這次的開發情境是需要顯示出原始HTML內容並且不想讓渲染後的內容包覆在中，另外在送出帶有HTML格式的內容時記得使用&lt;code&gt;Server.HtmlEncode()&lt;/code&gt;來進行編碼，否則ASP.NET會以XSS安全性為由產生錯誤提示。&lt;/p&gt;','基於開發需求，需要尋找一個可以顯示文字的控件，但Label內置的一些特點不符合我的開發需求，對於樣式的撰寫層級或是對純文字的展現就適合依靠Literal來解決問題。以下列出兩個控件的特點：Label可以設定樣式，Literal不行，他不包含任何HTML tag，因此也沒有CssClass屬性。Label可以直接渲染HTML內容，Literal需要加上屬性Mode=\"PassThrough\"。在Label中的文字會在內呈現，Literal為完全純文字，因此Label適用於JavaScript或JQuery的使用情境。以效能跟大小來說，Literal更為輕量，因為他不進行任何解析與樣式處理。如果顯示純文字或是原始HTML，那Literal的選擇更好。這次的開發情境是需要顯示出原始HTML內容並且不想讓渲染後的內容包覆在中，另外在送出帶有HTML格式的內容時記得使用Server.HtmlEncode()來進行編碼，否則ASP.NET會以XSS安全性為由產生錯誤提示。','ASP.NET,Literal,Label,Controls','2023-07-27 15:22:40',,'Y',0,'2023-07-27 15:22:40','2023-08-23 16:13:54'),(34,'B','ASP.NET Navigation Tech','&lt;hr&gt;&lt;p&gt;列舉幾個常用的跳轉頁面方式：&lt;/p&gt;&lt;ul&gt;&lt;li&gt;HyperLink&amp;nbsp;&lt;ol&gt;&lt;li&gt;在HTML中會被渲染為 &amp;lt;a&amp;gt;&lt;/li&gt;&lt;li&gt;&lt;mark class=&quot;marker-blue&quot;&gt;可以到內部頁面，也可以到外部網站&lt;/mark&gt;&lt;/li&gt;&lt;li&gt;不會觸發任何服務器端事件，所以沒有OnClick、OnCommand事件屬性&lt;/li&gt;&lt;/ol&gt;&lt;/li&gt;&lt;li&gt;Response.Redirect&lt;ol&gt;&lt;li&gt;適合用在需要事件處理後的跳轉&lt;/li&gt;&lt;li&gt;&lt;mark class=&quot;marker-blue&quot;&gt;可以到內部頁面，也可以到外部網站&lt;/mark&gt;&lt;/li&gt;&lt;li&gt;client redirect request ⇒ server，server response header ⇒ client，client GET request ⇒ server，server web server response ⇒ client，所以總共會有兩次請求響應循環&lt;/li&gt;&lt;/ol&gt;&lt;/li&gt;&lt;li&gt;Server.Transfer&lt;ol&gt;&lt;li&gt;&lt;mark class=&quot;marker-blue&quot;&gt;只能到內部頁面&lt;/mark&gt;&lt;/li&gt;&lt;li&gt;不會改變URL&lt;/li&gt;&lt;li&gt;可以直接獲取上一個頁面的值：Request.Form、Page.PreviousPage&lt;/li&gt;&lt;li&gt;client transfer request ⇒ server，server response new page ⇒ client，只會有一次請求響應，速度比Response.Redirect快&lt;/li&gt;&lt;/ol&gt;&lt;/li&gt;&lt;li&gt;Server.Execute&lt;ol&gt;&lt;li&gt;唯一和Server.Transfer不同的點在於跳轉後仍會顯示原先頁面，並且會回到原先頁面執行後續程式碼&lt;/li&gt;&lt;/ol&gt;&lt;/li&gt;&lt;li&gt;Cross-Page postback&lt;ol&gt;&lt;li&gt;設置PostBackUrl postback到其他頁面，因此&lt;mark class=&quot;marker-blue&quot;&gt;只能到內部頁面&lt;/mark&gt;&lt;/li&gt;&lt;li&gt;IsCrossPagePostBack屬性可用來偵測是否使用post來跳轉頁面&lt;/li&gt;&lt;/ol&gt;&lt;/li&gt;&lt;li&gt;Window.Open&lt;ol&gt;&lt;li&gt;JavaScript的跳轉方式，&lt;mark class=&quot;marker-blue&quot;&gt;可以到內部頁面，也可以到外部網站&lt;/mark&gt;&lt;/li&gt;&lt;li&gt;有許多參數可以對跳轉後的新頁面做更改，例如新頁面的視窗大小、滾動條、歷史紀錄覆蓋&lt;/li&gt;&lt;li&gt;可以搭配OnClientClick使用，也可以在OnClick事件中使用&amp;nbsp;&lt;/li&gt;&lt;/ol&gt;&lt;/li&gt;&lt;/ul&gt;&lt;pre&gt;&lt;code class=&quot;language-cs&quot;&gt;string js = &quot;window.open(&#39;Default.aspx&#39;)&quot;;\r\nResponse.Write(js);&lt;/code&gt;&lt;/pre&gt;','列舉幾個常用的跳轉頁面方式：HyperLink&nbsp;在HTML中會被渲染為 &lt;a&gt;可以到內部頁面，也可以到外部網站不會觸發任何服務器端事件，所以沒有OnClick、OnCommand事件屬性Response.Redirect適合用在需要事件處理後的跳轉可以到內部頁面，也可以到外部網站client redirect request ⇒ server，server response header ⇒ client，client GET request ⇒ server，server web server response ⇒ client，所以總共會有兩次請求響應循環Server.Transfer只能到內部頁面不會改變URL可以直接獲取上一個頁面的值：Request.Form、Page.PreviousPageclient transfer request ⇒ server，server response new page ⇒ client，只會有一次請求響應，速度比Response.Redirect快Server.Execute唯一和Server.Transfer不同的點在於跳轉後仍會顯示原先頁面，並且會回到原先頁面執行後續程式碼Cross-Page postback設置PostBackUrl postback到其他頁面，因此只能到內部頁面IsCrossPagePostBack屬性可用來偵測是否使用post來跳轉頁面Window.OpenJavaScript的跳轉方式，可以到內部頁面，也可以到外部網站有許多參數可以對跳轉後的新頁面做更改，例如新頁面的視窗大小、滾動條、歷史紀錄覆蓋可以搭配OnClientClick使用，也可以在OnClick事件中使用&nbsp;string js = \"window.open(\'Default.aspx\')\";\r\nResponse.Write(js);','redirect, hyperlink, transfer, postback, crosspage, navigation','2023-08-08 05:08:19',,'Y',0,'2023-08-08 05:08:19','2023-08-24 06:16:45');
INSERT INTO `notes` VALUES (35,'B','Cross webform send data method','&lt;hr&gt;&lt;ul&gt;&lt;li&gt;Context.Handler&lt;/li&gt;&lt;li&gt;QueryString&lt;ul&gt;&lt;li&gt;name/value的形式透過URL傳遞&lt;/li&gt;&lt;li&gt;第一個參數前使用&quot;?&quot;隔開，第二個參數開始使用&quot;&amp;amp;&quot;連接，例如localhost/Modify?id=35&amp;amp;title=&quot;Cross webform send data method&lt;/li&gt;&lt;li&gt;有長度限制&lt;/li&gt;&lt;li&gt;如果傳遞的文字包含&quot;&amp;amp;&quot;，可以使用UrlEncode將其編碼，就不會被視為參數&lt;/li&gt;&lt;li&gt;本網站傳遞參數的使用方式&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;Cookies&lt;ul&gt;&lt;li&gt;可透過cookie.expires定義失效時間&lt;/li&gt;&lt;li&gt;&lt;code&gt;Request.Browser.Cookies&lt;/code&gt;用來判斷瀏覽器是否支持Cookies，而非判斷瀏覽器是否啟用及禁用&lt;/li&gt;&lt;li&gt;只能存取string，所以需要先將其他型別的資料存儲前做轉換&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;/ul&gt;&lt;pre&gt;&lt;code class=&quot;language-cs&quot;&gt;// set cookie\r\nHttpCookie cookie = new HttpCookie(&quot;NoteInfo&quot;);\r\ncookie[&quot;id&quot;] = txtId.text;\r\ncookie.Expires = DateTime.Now.AddMinutes(10); // invalid after ten mins\r\nResponse.Cookies.add(cookie);\r\n// get cookie\r\nHttpCookie = Request.Cookies[&quot;NoteInfo&quot;];&lt;/code&gt;&lt;/pre&gt;&lt;ul&gt;&lt;li&gt;Session&lt;ul&gt;&lt;li&gt;&lt;code&gt;Session[&quot;id&quot;]&lt;/code&gt;儲存信息&lt;/li&gt;&lt;li&gt;預設20分鐘超時&lt;/li&gt;&lt;li&gt;停用Session&lt;ul&gt;&lt;li&gt;單一頁面：在.aspx上方&lt;code&gt;&amp;lt;%@ Page&amp;nbsp;Language=&quot;C#&quot; EnableSessionState=&quot;False&quot; %&amp;gt;&lt;/code&gt;&lt;/li&gt;&lt;li&gt;整個應用程式：在web.config → →&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;基於cookie存取session id識別唯一性，如果用戶停用cookie，可以在將id存取在URL，因此Response.redirect在跳轉內部頁面時盡量使用相對路徑而非絕對路徑，否則將覆蓋URL預設傳遞的值&lt;/li&gt;&lt;li&gt;&lt;code&gt;cookieless=&quot;AutoDetect&quot;&lt;/code&gt;只用來判定用戶瀏覽器是否支持cookie，不會偵測用戶是否禁用cookie&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;/ul&gt;','Context.HandlerQueryStringname/value的形式透過URL傳遞第一個參數前使用\"?\"隔開，第二個參數開始使用\"&amp;\"連接，例如localhost/Modify?id=35&amp;title=\"Cross webform send data method有長度限制如果傳遞的文字包含\"&amp;\"，可以使用UrlEncode將其編碼，就不會被視為參數本網站傳遞參數的使用方式Cookies可透過cookie.expires定義失效時間Request.Browser.Cookies用來判斷瀏覽器是否支持Cookies，而非判斷瀏覽器是否啟用及禁用只能存取string，所以需要先將其他型別的資料存儲前做轉換// set cookie\r\nHttpCookie cookie = new HttpCookie(\"NoteInfo\");\r\ncookie[\"id\"] = txtId.text;\r\ncookie.Expires = DateTime.Now.AddMinutes(10); // invalid after ten mins\r\nResponse.Cookies.add(cookie);\r\n// get cookie\r\nHttpCookie = Request.Cookies[\"NoteInfo\"];SessionSession[\"id\"]儲存信息預設20分鐘超時停用Session單一頁面：在.aspx上方&lt;%@ Page&nbsp;Language=\"C#\" EnableSessionState=\"False\" %&gt;整個應用程式：在web.config → →基於cookie存取session id識別唯一性，如果用戶停用cookie，可以在將id存取在URL，因此Response.redirect在跳轉內部頁面時盡量使用相對路徑而非絕對路徑，否則將覆蓋URL預設傳遞的值cookieless=\"AutoDetect\"只用來判定用戶瀏覽器是否支持cookie，不會偵測用戶是否禁用cookie','webform,data,query','2023-08-09 09:17:56',,'Y',0,'2023-08-09 09:17:56','2023-08-23 16:14:15');
